import Nav from './comp/Nav'
import Home from './pages/Home'
import Features from './pages/Features'
import Docs from './pages/Docs'
import Footer from './comp/Footer'
function App() {
  return (
    <div>
      <Nav/>
      <Home/>
      <Features/>
      <Docs/>
      <Footer/>
    </div>
  );
}

export default App;
